import './App.css';
import Nav from "./Components/Nav";
import { BrowserRouter as Switch , Router , Route} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/" >
        <Nav />
        </Route>
        <Route path="/companydetails" >
        <Nav />
        <h1>comapny</h1>
        </Route>
        <Route path="/emailverification" >
        <Nav />
        <h1>mail</h1>
        </Route>
      </Switch>

    </div>
    </Router>
  );
}

export default App;
